componentsModule.modules.last_update={start:function(){let current=componentsModule.modules.last_update;current.parentElement=document.querySelector("[data-component=last_update]");current.customCheck=current.parentElement.querySelector("[name=component_last-update]");current.dateBox=current.parentElement.querySelector(".component_last_custom");current.dateInput=current.dateBox.querySelector("input");current.clearInput=current.dateBox.querySelector(".clear-input");current.customCheck.checked=false;componentsModule.initializeEvents([{event:"change",element:current.customCheck,content:function(){if(!!(current.customCheck.checked)){current.dateBox.classList.remove("hide")}else{current.dateBox.classList.add("hide")}reloadPackery()}},{event:"click",element:current.clearInput,content:function(){current.dateInput.value=""}}])},resume:function(){let current=componentsModule.modules.last_update;const a=current.parentElement.getAttribute("data-resume");if(a===""){return true}current.dateInput.value=JSON.parse(a).last_update},validate:function(){return true},serialize:function(){let current=componentsModule.modules.last_update;const a=!!(current.customCheck.checked);let data=false;if(a&&current.dateInput.value!==""){data=current.dateInput.value.trim()}return{last_update:data}}};